import './App.css';
import Header from './Componants/Header';
import { BrowserRouter as Router,Routes,Route } from 'react-router-dom';

function App() {
  return (
   <>
   <Router>
   <Routes>
   <Route path="/"element={
   <React.Fragment>
   <Header/>
   <HomeBanner/>
   </React.Fragment>
   }/>
   <Route path="/login"element={
    <Login/>
  }/>
  <Route path="/dashboard"element={
    <React.Fragment>
    <Banner/>
    <List/>
    </React.Fragment>
  }/>
   </Routes>
   </Router>
   </>
  );
}

export default App;
